  input: TEXT,F3A,,"Amended 1-19-2007 to provide all information on individual donors
    and to itemize all disbursements. Wendy's PAC was not modified as it was determined
    in a phone call with Ms. Reminsky that no discrepancy existed. This filing purports
    to fail validation as a result of two separate situations. First, the filing keeps
    requesting the Lender information for the candidates' loans. However, all candidate
    loans were from the candidate's personal funds, therefore there is no lender.
    Second, the filing claims a contribution limit violation for VGM Management LTD
    PAC. VGM PAC had given $5000.00 during the Primary for the Primary and $500 during
    the Primary for the General Election. However, VGM PAC notified this Committee
    during this filing period that it has a contribution cap of $2100 per cycle. Therefore,
    it had exceeded it's contribution limit by $1300.00, and a $1300.00 excess contribution
    refund is recorded on this filing. Also, VGM Management PAC has asked that it's
    $4200 of remaining contributions be redesignated for $2100 per cycle (Primary
    and General Elections). Lastly, I have experienced problems with FecFile's file
    saving locations. My Amendment printout indicates all corrections have been made,
    and it is my expectation that all those corrections show in this amendment. Kirk
    Whalen, Treasurer"
